  [],\n\t\"revision_timestamp\": \"2015-09-27T01:35:38.035945\",\n\t\"name\": \"partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-alkalinity-temperatur208ee\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113522 includes chemical,
  discrete sample, physical and profile data collected from ATLANTIS II in the North
  Atlantic Ocean from 1989-04-20 to 1989-06-06 and retrieved during cruise CARINA/31AN19890420.
  These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Partial pressure (or fugacity)
  of carbon dioxide, Potential temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE.
  The instruments used to collect these data include CTD and bottle. These data were
  collected by P. Brewer of Commonwealth Scientific and Industrial Research Organization
  and Catherine Goyet of University of Perpignan via Domitia; Institute of Modeling
  and Analysis of Geo-Environment and Health as part of the CARINA/31AN19890420 data
  set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is
  an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\":
